import React from "react";

const AboutUs = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      <h1>About Us</h1>
    </motion.div>
  );
};

export default AboutUs;
